svg.script:
function r(h,a){document.getElementById(h).setAttribute("transform","rotate("+a+",400,300)")}
(function k(){
	var a=new Date,c=a.getFullYear(),e=a.getSeconds()+a.getMilliseconds()/1E3,f=a.getMinutes()+e/60,d=a.getHours()+f/60,l=a.getDay()+d/24,g=a.getDate()-1+d/24;
	c=a.getMonth()+g/[31,0!=c%4||0==c%100&&0!=c%400?28:29,31,30,31,30,31,31,30,31,30,31][a.getMonth()];
	a=a.getFullYear()-2020+c/12;
	r("seconds",e/60*-360);
	r("minutes",f/60*-360);
	r("hours",d/24*-360);
	r("days",l/7*-360);
	r("date",g/31*-360);
	r("months",c/12*-360);
	r("years",a/10*-360);
	window.requestAnimationFrame(k)
})();
